import useSWR from 'swr'

import Layout from '../components/Layout'
import ActionButton from '../components/Button'
import ImageRound from '../components/ImageRound'
import test from './test.txt'

const fetcher = (url) => {
    return fetch(url).then(r => r.json());
}

const Index = () => {
    const { data, error } = useSWR('/api/image', fetcher)

    const image = data?.image

    return (
        <div className="content">
            <ImageRound src={image} alt="Benjamin Killer" />
            <p>Bei langeweile kannst du gerne die Webseite meiner wundervollen Frau besuchen:</p>
            <ActionButton target='_blank' submitText="www.kwerbeed.de" link="https://www.kwerbeed.de" />
            <style jsx>{`
                .content {
                    display: flex;
                    flex: 1 1 auto;
                    align-items: center;
                    flex-direction: column;
                    justify-content: center;
                }
            `}</style>
        </div>
    )
}

export default Layout(Index)
